import React from 'react';

import {Link} from "react-router-dom";



export class TopBar extends React.Component{
	constructor(props){
		super(props);
		
		
	};
	
	render(){
		return(
		<div class="top-cont">
			<header>
			<div class="home-button-cont">
				
				<Link class="home-button" to="/shop" onClick={this.forceUpdate}>
					WebShop
				</Link>
			</div>
			
			<div>
			<input type="text" class="search-input">
			</input>
			</div>
			
					
			<nav>
				<ul class="navigation" id="nav">
					<li>
						<Link class="nav-button" to="/singin" onClick={this.forceUpdate}>Sign in</Link>
						<Link class="nav-button" to="/signup" onClick={this.forceUpdate}>Sign up</Link>
						<Link class="nav-button" to="/account" onClick={this.forceUpdate}>Account</Link>
						<Link class="nav-button" to="/myitems" onClick={this.forceUpdate}>My Items</Link>
						<Link class="nav-button" to="/cart" onClick={this.forceUpdate}>Shopping Cart</Link>
					</li>
				</ul>
			</nav>
					
			</header>
				
				
				
		</div>
		);
	};
	
}
